import { BrowserRouter, Route, Routes } from "react-router-dom";
import { useEffect, useState } from "react";
import axios from "axios";
import "./Assets/styles/style.css";
import "./Assets/styles/Footer.css";
import "./Assets/styles/register.css";
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.bundle.min.js";
import "bootstrap-icons/font/bootstrap-icons.css";
import Navbar from "./Components/Navbar";
import Main from "./Components/Main";
import Footer from "./Components/Footer";
import About from "./Components/About";
import Login from "./Components/Login";
import Registration from "./Components/Registration";
import DocReg from "./Components/DocReg";
import CustomerReg from "./Components/CustomerReg";

import Trainerreg from "./Components/Trainerreg";

function App() {
  const [auth, setauth] = useState(false);

  const loginfn = () => {
    setauth(true);
  };
  const logoutfn = () => {
    setauth(false);
  };

  return (
    <BrowserRouter>
      <div className="App">
        <button onClick={loginfn}> Login </button>
        <button onClick={logoutfn}> Logout</button>
        <Navbar auth={auth} />
        <Routes>
          <Route exact path="/" element={<Main />} />
          <Route path="/Home" element={<Main />} />
          <Route path="/Register" element={<Registration />} />
          <Route path="/Register/cusreg" element={<CustomerReg />} />
          <Route path="/Register/docreg" element={<DocReg />} />
          <Route path="/Register/trainerreg" element={<Trainerreg />} />
          <Route path="/Login" element={<Login />} />
          <Route path="/About" element={<About />} />
          <Route path="/*" element={ <div className="errorpage"> </div>} />
        </Routes>
        <Footer />   
      </div>
    </BrowserRouter>
  );
}

export default App;
